script: |
  super -f text -I q8608.spq | sort > q8608.out

inputs:
  - name: q8608.spq
    data: |
      SELECT + col0 + + col2 - + col2 + + + col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + ( + + 37 ) * - + col0 * + - col2 + - col1 * - + 96 NOT IN ( + col2 * - col0 + - + 33, + col2 + 17 );
  - name: tab1

outputs:
  - name: q8608.out
    data: |
      102
      170
      182
